sect1.para:
Usually, you first create an instance: QCPStatisticalBox*newBox=newQCPStatisticalBox(customPlot->xAxis,customPlot->yAxis);
 add it to the customPlot with QCustomPlot::addPlottable: customPlot->addPlottable(newBox);
 and then modify the properties of the newly created plottable, e.g.: newBox->setName("MeasurementSeries1");
newBox->setData(1,3,4,5,7);
newBox->setOutliers(QVector<double>()<<0.5<<0.64<<7.2<<7.42);
